pub fn get_ansi_root_grammar_id() -> GrammarId {
    GrammarId(1264)
}
pub fn get_ansi_root_grammar_table() -> RootGrammar {
    RootGrammar::TableDriven {
        grammar_id: get_ansi_root_grammar_id(),
        tables: &ANSI_TABLES,
    }
}
pub fn get_ansi_root_grammar() -> RootGrammar {
    get_ansi_root_grammar_table()
}
